import React, {useRef} from 'react'
import {Swiper, SwiperSlide, useSwiper} from 'swiper/react';
import 'swiper/css';

import PropTypes from 'prop-types'

import './trending.css'
import {Navigation} from "swiper";

const Trending = (props) => {
    const swiperRef = useRef();

    return (
        <>
        <Swiper
            slidesPerView={'auto'}
            loop={true}
            modules={[Navigation]}
            onBeforeInit={(swiper) => {
                swiperRef.current = swiper;
            }}
            onSlideChange={() => console.log('slide change')}
            onSwiper={(swiper) => console.log(swiper)}
        >
            <SwiperSlide>
                <div className={'trending-item red'}></div>
            </SwiperSlide>
            <SwiperSlide>
                <div className={'trending-item blue'}></div>
            </SwiperSlide>
            <SwiperSlide>
                <div className={'trending-item red'}></div>
            </SwiperSlide>
            <SwiperSlide>
                <div className={'trending-item blue'}></div>
            </SwiperSlide>
        </Swiper>
            <div>
                <button onClick={() => swiperRef.current?.slidePrev()}><svg width="48" height="48" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <circle cx="24" cy="24" r="23.5" transform="rotate(90 24 24)" stroke="#716B7C"/>
                    <path d="M25.9988 30L27.4088 28.59L22.8288 24L27.4088 19.41L25.9988 18L19.9988 24L25.9988 30Z" fill="white"/>
                </svg>
                </button>
                <button onClick={() => swiperRef.current?.slideNext()}>Next</button>
            </div>
        </>
    )
}


export default Trending
